INSERT INTO `meaning` VALUES (1,'a large wild animal of the cat','The zoo has a large collection of tigers.'),(2,'any living or extinct member of the family Hominidae characterized by superior intelligence, articulate speech, and erect carriage','I am a human.'),(3,'having human form or attributes as opposed to those of animals or divine beings','the experiment was conducted on 6 monkeys and 2 human subjects.'),(4,'a reference book containing an alphabetical list of words with information about them.','Search the word in Dictionary.'),(5,'It is an elongated, edible fruit â€“ botanically a berry â€“ produced by several kinds of large herbaceous flowering plants in the genus Musa.','Monkey likes to eat banana.'),(6,'a written or printed work consisting of pages glued or sewn together along one side and bound in covers.','I am reading a good book on economics.'),(7,'reserve (accommodation, a place, etc.)','I have booked a table at the Swan'),(8,'a reference book containing an alphabetical list of words with information about them','This information is obtained from the lexicon.'),(9,'a language user\'s knowledge of words','Chocolate equals sin in most people\'s lexicon.'),(10,'physical objects consisting of a number of pages bound together','he used a large book as a doorstop.'),(11,'the magnitude of sound','the kids played their music at full volume.'),(12,'a (usually) large and scholarly book','She\'s written several weighty tomes on the subject.'),(13,'the indefinite continued progress of existence and events in the past, present, and future regarded as a whole.','he waited for a long time'),(14,'plan, schedule, or arrange when (something) should happen or be done.','the first track race is timed for 11.15'),(15,'a period of time equal to 1/24th of a day','the job will take more than an hour'),(16,'a special and memorable period','it was their finest hour'),(17,'doing something or taking place after the expected, proper, or usual time.','his late arrival'),(18,'far on in time; towards the end of a period.','it happened late in 1963.'),(19,'happening or doing something at the agreed or proper time.','he\'s the sort of person who\'s always punctual'),(20,'performed with little or no delay','a prompt reply'),(21,'a cue given to a performer (usually the beginning of the next line to be spoken)','the audience could hear his prompting'),(22,'serve as the inciting cause of','She prompted me to call my relatives'),(23,'to travel to a place','went to the gas station before heading home.'),(24,'the act or manner of going','finished the job at one go'),(25,'a person of subnormal intelligence','he is an idiot.'),(26,'having the capacity for thought and reason especially to a high degree','an intelligent question'),(27,'having or showing a quick-witted intelligence.','if he was that smart he would never have been tricked'),(28,'(of a wound or part of the body) feel or cause a sharp stinging pain.','her legs were scratched and smarting.'),(29,'intelligence','I don\'t think I have the smarts for it.'),(30,'temporarily unable or unwilling to speak.','they stood dumb while the attacker poured out a stream of abuse'),(31,'make dumb or unheard; silence.','a splendour that dazed the mind and dumbed the tongue'),(32,'(of an object) having an edge or point that is able to cut or pierce something.','cut the cake with a very sharp knife'),(33,'precisely (used after an expression of time).','the meeting starts at 7.30 sharp'),(34,'a musical note raised a semitone above natural pitch','play a c-sharp.'),(35,'intelligent and quick-witted.','a bright idea'),(36,'brightly.','a full moon shining bright'),(37,'bold and vivid colours.','a choice of colours from pastels through to brights'),(38,'stupid; very foolish.','there are dozens of brainless action movies out there'),(39,'move forward.','from the High Street, proceed over Magdalen Bridge'),(40,'have or maintain an upright position, supported by one\'s feet.','Lionel stood in the doorway'),(41,'an attitude towards a particular issue; a position taken in an argument.','the party\'s tough stand on immigration'),(42,'bring or come to an abrupt stop.','there is growing pressure to halt the bloodshed'),(43,'a suspension of movement or activity, typically a temporary one.','a halt in production'),(44,'(of an event, action, or process) come to an end; cease to happen.','his laughter stopped as quickly as it had begun'),(45,'a cessation of movement or operation.','all business came to a stop'),(46,'a domesticated carnivorous mammal that typically has a long snout, an acute sense of smell, non-retractable claws, and a barking, howling, or whining voice.','he had pet dog.'),(47,'a small domesticated carnivorous mammal with soft fur, a short snout, and retractable claws. It is widely kept as a pet or for catching mice, and many breeds have been developed.','he have many variety of cat.'),(48,'a member of a North American people formerly living in southern Wisconsin, and now mainly in Iowa, Nebraska, and Kansas.','he acts like a fox.'),(49,'a very large plant-eating mammal with a prehensile trunk, long curved ivory tusks, and large ears, native to Africa and southern Asia. It is the largest living land animal.','The elephant is the world\'s largest living creature.'),(50,'a nocturnal bird of prey with large eyes, a facial disc, a hooked beak, and typically a loud hooting call.','The owl is a predatory bird which kills its prey with its claws.'),(51,'A speaker or writer uses I to refer to himself or herself.','I reached home at six in the evening.'),(52,'at a lower level than.','the room under his study'),(53,'used to connect words of the same part of speech, clauses, or sentences, that are to be taken jointly.','bread and butter'),(54,'used to express grief, pity, or concern','Alas! That is really sad.');
